import React, { Component } from 'react';
import './comments.css';

class Comments extends Component {
    
    render() { 
        return (  
            <div className="comments-div">
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
                <h3 className="Comments-heading">Comments</h3>
                <input type="text" placeholder="Your Name" className="comments-name"></input>
                <input type="text" placeholder="Your Comment" className="add-comments"></input>
                <button className="btn btn-primary">Comment</button>
                <div>
                    <ul className="list-to-be-added"></ul>
                </div>
            </div>
        );
    }
    
}
 
export default Comments;
